import React from 'react';
import styled from 'styled-components';
import './App.css';

const AppContainer = styled.div`
${`
  w-full
  h-full
  flex
  flex-col
`}
`;

function App() {
  return (
    <div className="App">
      Hello World
    </div>
  );
}

export default App;
